import React from 'react';
import '../App.css';

function cabecalho() {
  return (
    <div>
      <div className="Topo">
        <header className="container">
          <div className="front">
            <p className="logo">SCC</p>
            <p>
              Sistema de Cadastro de Clientes
            </p>
          </div>
        </header>
      </div>
    </div>
  );
}

export default cabecalho;
